import React from "react";

let AddContact = () => {
    return (
      <React.Fragment>
        <section className="add-contact p-3">
          <div className="container">
            <div className="row">
              <div className="col">
                <p className="h4 text-success fw-bold">Create Contact</p>
              </div>
            </div>
          </div>
        </section>
      </React.Fragment>  
    )
};

export default AddContact;
